import React from "react";
import SavedContainer from "../SavedContainer";

const Saved = () => (
  <div>
    <SavedContainer />
    <div>
        <h3>You are at the SAVED page</h3>
        <h1>CONGRATULATIONS</h1>
    </div>
  </div>
);

export default Saved;
